import React from "react";
import AppConfig from "../Sections/AppConfig";
import Cookies from "universal-cookie";

const cookies = new Cookies();
let env = cookies.get("userEnv");

const HomeView = () => {
  if (env !== undefined) {
    return (
      <div className="home">
        <AppConfig />
      </div>
    );
  }
};
export default HomeView;
